try:
    n = int(input("Masukkan jumlah deret (n): "))
    if n <= 0:
        print("Masukkan angka positif.")
    else:
        a, b = 0, 1
        result = []
        for _ in range(n):
            result.append(str(a))
            a, b = b, a + b
        print(f"Deret Fibonacci ({n}): {', '.join(result)}")
except ValueError:
    print("Masukkan angka yang valid.")
